  input: '"TEXT","F3XA","C00143743","The committee has received the Commission''s
    letter of May 14, 2003.  In response, the Committee would like to ensure the Commission
    that the Committee is in compliance with regard to the  Regulations on Exempt
    expenditures.  Futhermore, the Committee used no transfers from national party
    committees to pay for such exempt expenditures. In reference to the Commission''s
    second item: The transfers made to the non-federal account were made for refunds/reimbursements
    received by the Committee and shown on Schedule A Line 15, as referenced in the
    original report. In addition to the vendors listed (Hawkins, Lofton, Olsten, and
    USPS), the refunds/reimbursements were made by former and current employees of
    the Committee for COBRA health insurance payments by the Committee to Humana,
    and by the Texas Federation of Republican Women for sub-lease rent/parking, postage,
    and telephone expenses. The payments to the vendors (Humana, Southwest Educational
    Development Lab, Highland Resources, and Logix Communications) are reported within
    this report. Reimbursement was made either prior to the expenditure or within
    a commercially reasonable time. Transfers were also made for the federal share
    of non-federal in-kind contributions which are listed in Schedule A Line 11 and
    Schedule H4, as required."'
